        static Dictionary<char, int> getDictCount(string str)
        {
            Dictionary<char, int> t = (from a in str.ToCharArray().GroupBy(x => x) select a).ToDictionary(
                                                                            p => p.Key,
                                                                            p => p.Count()
                                                                            );

            Dictionary<char, int> mTot = new Dictionary<char, int>();
            mTot.Add('A', getValueMap(t, 'A'));
            mTot.Add('C', getValueMap(t, 'C'));
            mTot.Add('G', getValueMap(t, 'G'));
            mTot.Add('T', getValueMap(t, 'T'));

            return mTot;
        }

        static int getValueMap(Dictionary<char, int> t, char e)
        {
            int v = 0;
            t.TryGetValue(e, out v);
            return v;
        }

        static int getValueCut(Dictionary<char, int> t, char e)
        {
            int v = 0;
            t.TryGetValue(e, out v);
            int r = v - ma;
            if (r < 0)
            {
                return 0;
            }
            return r;
        }

        static bool isSteady(Dictionary<char, int> t)
        {
            if (t['A'] == ma && t['A'] == t['C'] && t['A'] == t['G'] && t['A'] == t['T'])
            {
                return true;
            }

            return false;
        }



        static int steadyGene_SLOW_15Points(string gene)
        {
            int min = 1000000000;
            ma = gene.Length / 4;

            Dictionary<char, int> mTot = getDictCount(gene);
            if (isSteady(mTot))
            {
                return 0;
            }

            Dictionary<char, List<int>> mPos = new Dictionary<char, List<int>>();
            mPos.Add('A', new List<int>());
            mPos.Add('C', new List<int>());
            mPos.Add('G', new List<int>());
            mPos.Add('T', new List<int>());

            for (int i = 0; i < gene.Length; i++)
            {
                mPos[gene[i]].Add(i);
            }

            Dictionary<char, int> gCut = new Dictionary<char, int>();
            gCut.Add('A', getValueCut(mTot, 'A'));
            gCut.Add('C', getValueCut(mTot, 'C'));
            gCut.Add('G', getValueCut(mTot, 'G'));
            gCut.Add('T', getValueCut(mTot, 'T'));

            int count = 0;
            int n1 = 0;
            int n2 = 0;
            int n3 = 0;
            int n4 = 0;
            //int p1 = 0;
            //int p2 = 0;
            int maxV = 0;
            char c1 = '_';
            char c2 = '_';
            char c3 = '_';
            char c4 = '_';

            int[] mp;
            List<int> mp1 = new List<int>();
            List<int> mp2 = new List<int>();
            List<int> mp3 = new List<int>();
            List<int> mp4 = new List<int>();
            foreach (KeyValuePair<char, int> e in gCut.Where(e => e.Value > 0))
            {
                count += 1;

                if (count == 1)
                {
                    mp1 = mPos[e.Key];
                    n1 = e.Value;
                    //p1 = mp1[0];
                    c1 = e.Key;
                }
                else if (count == 2)
                {
                    mp2 = mPos[e.Key];
                    n2 = e.Value;
                    //p2 = mp2[0];
                    c2 = e.Key;
                }
                else if (count == 3)
                {
                    mp3 = mPos[e.Key];
                    n3 = e.Value;
                    //p3 = mp2[0];
                    c3 = e.Key;
                }
                else if (count == 4)
                {
                    mp4 = mPos[e.Key];
                    n4 = e.Value;
                    //p4 = mp2[0];
                    c4 = e.Key;
                }

                if (e.Value > maxV)
                {
                    maxV = e.Value;
                }

            }

            if (count == 1 && maxV == 1)
            {
                return 1;
            }

            int nCut = n1 + n2;
            int dist = 0;

            mp = new int[nCut];
            mp = mp1.Concat(mp2).Concat(mp3).Concat(mp4).OrderBy(x => x).ToArray();

            int k = 0;
            int start = 0;
            int end = 0;
            int indP = 0;
            int cn1 = 0;
            int cn2 = 0;
            int cn3 = 0;
            int cn4 = 0;
            int g = 0;

            while (g + nCut - 1 < mp.Count())
            {
                if (cn1 == 0 && cn2 == 0 && cn3 == 0 && cn4 == 0)
                {
                    start = mp[g];
                    k = g;
                }
                indP = mp[k];

                if (gene[indP].Equals(c1)) { cn1 += 1; }
                if (gene[indP].Equals(c2)) { cn2 += 1; }
                if (gene[indP].Equals(c3)) { cn3 += 1; }
                if (gene[indP].Equals(c4)) { cn4 += 1; }

                if (cn1 >= n1 && cn2 >= n2 && cn3 >= n3 && cn4 >= n4)
                {
                    end = indP;
                    dist = end - start + 1;

                    if (dist >= 0 && dist < min)
                    {
                        min = dist;
                    }
                    cn1 = 0;
                    cn2 = 0;
                    cn3 = 0;
                    cn4 = 0;
                    g += 1;
                }

                k += 1;
                if (k == mp.Count())
                {
                    cn1 = 0;
                    cn2 = 0;
                    cn3 = 0;
                    cn4 = 0;
                    g += 1;
                    k = g;
                }
            }

            return min;
        }

